import React from 'react';

const About = () => {
  return (
    <section className="min-h-screen flex items-center justify-center bg-gray-50 dark:bg-gray-900">
      <div className="text-center p-8">
        <h1 className="text-4xl font-bold text-gray-900 dark:text-white mb-4">About Me</h1>
        <p className="text-lg text-gray-600 dark:text-gray-300 mb-8">
          This is a simplified version of the about page.
        </p>
        <div className="space-y-4">
          <p className="text-gray-700 dark:text-gray-300">Full Stack Developer</p>
          <p className="text-gray-700 dark:text-gray-300">Passionate about building amazing web experiences</p>
        </div>
      </div>
    </section>
  );
};

export default About;
